package a;

import java.util.HashMap;

/**
 * Input: S = "ADOBECODEBANC", T = "ABC"
 * Output: "BANC"
 * <p>
 * 如果 S 中不存这样的子串，则返回空字符串 ""。
 * 如果 S 中存在这样的子串，我们保证它是唯一的答案。
 *
 * Tips:
 * Integer判断值相同用equals别用== 不然最后一个测试用例跑不通
 */
public class MinimumWindowSubstring {
    public String minWindow(String s, String t) {
        HashMap<Character, Integer> need = new HashMap<>();
        HashMap<Character, Integer> window = new HashMap<>();
        for (Character c : t.toCharArray()) {
            need.put(c, need.getOrDefault(c, 0) + 1);
        }
        int left = 0;
        int right = 0;
        //满足need条件的字符个数
        int vaild = 0;
        //记录最小覆盖子串的其实索引和长度
        int start = 0;
        int len = Integer.MAX_VALUE;
        while (right < s.length()) {
            //c是即将移入窗口的字符
            char c = s.charAt(right);
            //右移窗口
            right++;
            //进行窗口内数据更新
            if (need.containsKey(c)) {
                window.put(c, window.getOrDefault(c, 0) + 1);
                if (window.get(c).equals(need.get(c))) {
                    vaild++;
                }
            }
            //判断左侧窗口是否需要收缩
            while (vaild == need.size()) {
                //更新最小覆盖子串
                if (right - left < len) {
                    start = left;
                    len = right - left;
                }
                //d是即将移除的字符
                char d = s.charAt(left);
                //左移窗口
                left++;
                //进行窗口内数据更新
                if (need.containsKey(d)) {
                    if (window.get(d).equals(need.get(d))) {
                        vaild--;
                    }
                    window.put(d, window.get(d) - 1);
                }
            }
        }
        //返回最小覆盖子串
        return len == Integer.MAX_VALUE ? "" : s.substring(start, start + len);
    }

    public static void main(String[] args) {
        StringBuilder a = new StringBuilder();
        StringBuilder b = new StringBuilder();
        a.append("");
        b.append("");

//        String expect = "";
//        System.out.println(expect.length());

        String c = "ADOBECODEBANC";
        String d = "ABC";
        System.out.println(new MinimumWindowSubstring().minWindow(a.toString(), b.toString()));
        System.out.println("-----------");
//        System.out.println(new MinimumWindowSubstring().minWindow(c, d));
        //100000
        System.out.println(a.toString().length());
    }
}
